import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import { ScreenA } from '../screens/ScreenA';
import { ScreenB } from '../screens/ScreenB';
import { ScreenC } from '../screens/ScreenC';
import { ScreenD } from '../screens/ScreenD';

const Stack = createStackNavigator();
const AuthStack = createStackNavigator();
const AppTabs = createMaterialTopTabNavigator();

const AuthenticatedNavigator: React.FC = () => {
  return (
    <AppTabs.Navigator>
      <AppTabs.Screen name="Ambientes" component={ScreenA} />
      <AppTabs.Screen name="Reservas" component={ReservationsScreen} />
    </AppTabs.Navigator>
  );
};

const Routes: React.FC = () => {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Login" component={LoginScreen} options={{ headerShown: false }} />
      <Stack.Screen name="Cadastro" component={SignupScreen} options={{ headerShown: false }} />
      <Stack.Screen name="Ambientes" component={AuthenticatedNavigator} options={{ headerShown: false }} />
    </Stack.Navigator>
  );
};

export default Routes;
